import React from 'react';
import Article from './Article';

export default function ArticleList({ articles }) {
  return (
    <ul>
      <li><Article articles = {articles[0]}></Article></li>
      <li><Article articles = {articles[1]}></Article></li>
      <li><Article articles = {articles[2]}></Article></li>
    </ul>
  )
}
